import React,{Component} from "react";

class NewTask extends Component{
    constructor(props) {
        super(props);
        this.state= {
            inputValue:'',
            List: ['学习React技术', '学习后端API']
        }
    }

    render() {
        return(
            <div className="taskBox">
                <label htmlFor="boxText">新建任务:</label>
                <input
                    id="boxText"
                    className="boxText"
                    type="text"
                />
                <button className="boxBtn">保存</button>
            </div>
        );
    }
}
export default NewTask;
